        async function loadData() {
            try {
                allData = JSON.parse(embeddedData);
                const periods = [...new Set(allData.map(d => d.periods))].length;
                const routes = [...new Set(allData.map(d => d.route))].length;
                document.getElementById('dataInfo').textContent = 
                    `Dataset: ${allData.length} records | ${periods} time periods | ${routes} unique routes`;
                createChart(10, 'all');
            } catch (error) {
                document.getElementById('dataInfo').textContent = 'Error loading data';
                console.error(error);
            }
        }
        
        function createChart(topN = 10, periodLimit = 'all') {
            if (allData.length === 0) return;
            
            // Group data by period
            const periodMap = {};
            allData.forEach(item => {
                if (!periodMap[item.periods]) {
                    periodMap[item.periods] = [];
                }
                periodMap[item.periods].push(item);
            });
            
            // Get unique periods and limit them
            let periods = Object.keys(periodMap).sort();
            if (periodLimit !== 'all') {
                periods = periods.slice(0, parseInt(periodLimit));
            }
            
            // Get top N routes by total count across all periods
            const routeTotals = {};
            allData.forEach(item => {
                if (!routeTotals[item.route]) {
                    routeTotals[item.route] = 0;
                }
                routeTotals[item.route] += parseInt(item._count);
            });
            
            const topRoutes = Object.entries(routeTotals)
                .sort((a, b) => b[1] - a[1])
                .slice(0, topN)
                .map(([route]) => route);
            
            // Prepare datasets
            const colors = [
                '#FF6384', '#36A2EB', '#FFCE56', '#4BC0C0', '#9966FF',
                '#FF9F40', '#FF6384', '#C9CBCF', '#4BC0C0', '#FF6384',
                '#36A2EB', '#FFCE56', '#4BC0C0', '#9966FF', '#FF9F40',
                '#E7E9ED', '#71B37C', '#EC6B56', '#FFC870', '#36A2EB'
            ];
            
            const datasets = topRoutes.map((route, idx) => {
                const data = periods.map(period => {
                    const periodData = periodMap[period] || [];
                    const routeData = periodData.find(d => d.route === route);
                    return routeData ? parseInt(routeData._count) : 0;
                });
                
                return {
                    label: route,
                    data: data,
                    backgroundColor: colors[idx % colors.length],
                    borderColor: colors[idx % colors.length],
                    borderWidth: 1
                };
            });
            
            // Format period labels
            const labels = periods.map(p => {
                const time = p.split(' ')[1];
                return time.substring(0, 5);
            });
            
            // Destroy existing chart
            if (chart) {
                chart.destroy();
            }
            
            // Create new chart
            const ctx = document.getElementById('routeChart').getContext('2d');
            chart = new Chart(ctx, {
                type: 'bar',
                data: {
                    labels: labels,
                    datasets: datasets
                },
                options: {
                    responsive: true,
                    maintainAspectRatio: false,
                    plugins: {
                        title: {
                            display: true,
                            text: `Top ${topN} Routes by Time Period (${periods.length} periods)`,
                            font: { size: 16 }
                        },
                        legend: {
                            display: true,
                            position: 'right',
                            labels: {
                                boxWidth: 15,
                                font: { size: 11 }
                            }
                        },
                        tooltip: {
                            callbacks: {
                                label: function(context) {
                                    return context.dataset.label + ': ' + context.parsed.y + ' flights';
                                }
                            }
                        }
                    },
                    scales: {
                        x: {
                            title: {
                                display: true,
                                text: 'Time Period (HH:MM)',
                                font: { size: 14 }
                            },
                            ticks: {
                                maxRotation: 45,
                                minRotation: 45,
                                font: { size: 10 }
                            }
                        },
                        y: {
                            title: {
                                display: true,
                                text: 'Count',
                                font: { size: 14 }
                            },
                            beginAtZero: true
                        }
                    }
                }
            });
        }
        
        // Event listeners
        document.getElementById('topRoutes').addEventListener('change', (e) => {
            const topN = parseInt(e.target.value);
            const periodLimit = document.getElementById('periodLimit').value;
            createChart(topN, periodLimit);
        });
        
        document.getElementById('periodLimit').addEventListener('change', (e) => {
            const topN = parseInt(document.getElementById('topRoutes').value);
            const periodLimit = e.target.value;
            createChart(topN, periodLimit);
        });
        
        // Initialize
        loadData();
    </script>
